        const actualData = await res.json();
    }
    
    // console.log(actualData,statewise[1].state)

    return (
        <>
        <ApiData />
        {/* <h1>{state}</h1> */}
        <button onClick={getCovidData}>{actualData.statewise[1].state}</button>
        {/* <button onClick={()=>{
            setstate(actualData.statewise[1].state);
        }}></button> */}
        </>
    )
};

export default App;
